function highlightFeature(e) {
    var layer = e.target;

    layer.setStyle({
        weight: 2,
        color: '#DAE02F',
        dashArray: '',
        opacity: 1,
    });

    if (!L.Browser.ie && !L.Browser.opera) {
        layer.bringToFront();
    }
}


function resetHighlight(e) {
	geoJson.eachLayer(function(layer) {
        if ((timestamp >= layer.feature.properties.YEAR) && (layer.feature.properties.YEAR != 0)) {
            layer.setStyle({
                fillColor: '#00DB0F',
                color: '#00DB0F',
                weight: 1,
                fillOpacity: 0.8,
            })
        } else  {
            layer.setStyle({
				color: '#00DB0F',
                fillOpacity: 0.1,
                opacity: 0,
            });
        };
	});
	geoJsonNone.eachLayer(function(layer) {
            layer.setStyle({
                color: '#000000',
                fillOpacity: 0.1,
                opacity: 0,
            });
	});
}


