function onEachFeature(feature, layer) {
    layer.on({
        mouseover: highlightFeature,
        mouseout: resetHighlight,
    });
	
	var popupHTML = '<center><h5>' + feature.properties.BLDNAME + '</h5> </center>';

	layer.bindPopup(popupHTML);
	layer.on('click', function() {
		document.getElementById('sidebarHeader').innerHTML = feature.properties.BLDNAME;
		document.getElementById('sidebarHeader2').innerHTML = feature.properties.YEAR;
		document.getElementById('sidebarImg').innerHTML = "<img src='"+feature.properties.PHOTO+"' width='200px'/>";
		document.getElementById('sidebarContent').innerHTML = "<center>Architects: " + feature.properties.ARCHITECT + "</center><br>";
		document.getElementById('sidebarContentAuthor').innerHTML = "";

		
		
	});
		return false;
}



function updateLayers(feature, layer) {
    var legendYear = document.getElementById("legendYear");
    legendYear.innerHTML = "<center><h1>" + timestamp + "</h1></center>";
	
    geoJson.eachLayer(function(layer) {
        if ((timestamp >= layer.feature.properties.YEAR) && (layer.feature.properties.YEAR != 0)) {
            layer.setStyle({
                fillColor: '#00DB0F',
                color: '#00DB0F',
                weight: 1,
                fillOpacity: 0.8,
            })
        } else if ((timestamp <= layer.feature.properties.YEAR) && (layer.feature.properties.YEAR != 0)) {
            layer.setStyle({
                color: '#00DB0F',
                fillOpacity: 0.1,
                opacity: 0,
            });
        };
    });
};

function sequenceInteractions() {
    $(".pause").hide();
    $(".play").click(function() {
        $(".pause").show();
        $(".play").hide();
        animateMap();
    });
    $(".pause").click(function() {
        $(".pause").hide();
        $(".play").show();
        stopMap();
    });
    $(".step").click(function() {
        step();
    });
    $(".step-full").click(function() {
        jump(2015);
    });
    $("#temporalSlider").slider({
        min: 1875,
        max: 2015,
        step: 1,
        animate: 'fast',
        slide: function(e, ui) {
            stopMap();
            timestamp = ui.value;
            updateLayers();
        }
    });
    $(".back").click(function() {
        back();
    });
    $(".back-full").click(function() {
        jump(1875);
    });
};

function animateMap() {
    timer = setInterval(function() {
        step();
    }, timerInterval);
};

function stopMap() {
    clearInterval(timer);
}

function back() {
    if (timestamp > 1875) {
        timestamp -= 1;
    } else {
        timestamp = 2015;
    };
    updateLayers();
    updateSlider();
};

function step() {
    if (timestamp < 2015) {
        timestamp += 1;
    } else {
        timestamp = 1875;
    };
    updateLayers();
    updateSlider();
}

function jump(t) {
    timestamp = t;
    updateLayers();
    updateSlider();
}

function updateSlider() {
    $("#temporalSlider").slider("value", timestamp);
}


